import 'package:flutter/material.dart';
import 'package:flutter_debugger_toolkit/src/loction_emiiter/location_emitter_service.dart';

class LocationReplayerCreateScreen extends StatefulWidget {
  final Function(PointLocationReplayer) onLocationReplayerCreated;
  const LocationReplayerCreateScreen({
    Key? key,
    required this.onLocationReplayerCreated,
  }) : super(key: key);

  @override
  State<LocationReplayerCreateScreen> createState() =>
      _LocationReplayerCreateScreenState();
}

class _LocationReplayerCreateScreenState
    extends State<LocationReplayerCreateScreen> {
  final inputTextController = TextEditingController();

  @override
  void initState() {
    super.initState();
  }

  @override
  Widget build(BuildContext context) {
    final theme = Theme.of(context);
    return Scaffold(
      appBar: AppBar(
        title: Text('Location Replayer'),
      ),
      body: SafeArea(
        child: Padding(
          padding: const EdgeInsets.all(16.0),
          child: Column(
            children: [
              Expanded(
                child: Container(
                  decoration: BoxDecoration(
                    borderRadius: BorderRadius.circular(8),
                    border: Border.all(
                      color: theme.colorScheme.primary,
                    ),
                  ),
                  child: TextFormField(
                    controller: inputTextController,
                    keyboardType: TextInputType.multiline,
                    maxLines: null,
                    decoration: InputDecoration(
                      border: InputBorder.none,
                    ),
                  ),
                ),
              ),
              Expanded(
                child: Wrap(
                  children: [
                    TextButton(
                      onPressed: () {
                        widget.onLocationReplayerCreated
                            .call(PointLocationReplayer.gpx(
                          gpxString: inputTextController.text,
                        ));
                      },
                      child: Text('GPX'),
                    ),
                    TextButton(
                      onPressed: () {
                        widget.onLocationReplayerCreated
                            .call(PointLocationReplayer.geometry(
                          gemetry: inputTextController.text,
                          precision: 6,
                        ));
                      },
                      child: Text('Geometry precision 6'),
                    ),
                    TextButton(
                      onPressed: () {
                        widget.onLocationReplayerCreated
                            .call(PointLocationReplayer.geometry(
                          gemetry: inputTextController.text,
                          precision: 5,
                        ));
                      },
                      child: Text('Geometry precision 5'),
                    ),
                    TextButton(
                      onPressed: () {
                        widget.onLocationReplayerCreated
                            .call(PointLocationReplayer.geometry(
                          gemetry: _sgPy,
                          precision: 6,
                        ));
                      },
                      child: Text('SG Phu Yen'),
                    ),
                  ],
                ),
              ),
            ],
          ),
        ),
      ),
    );
  }
}

